@BellaHadid has a new title to add to her list: co-founder and partner of @KinEuphorics.

A non-alcoholic product, Kin includes Gaba, a naturally-occurring nootropic chemical that promotes relaxation, and Tyrosine, a mood enhancer. And while celebrity endorsements and brand ambassador roles are nothing new, as co-founder Hadid is taking on a significant role within the company. In addition to her own investment, she’ll help run point on everything from branding to social initiatives and formulation.

Kin drinks will soon be infused with lavender grown on the Hadid family farm in Pennsylvania. Bella is not content with just being the face of a brand—she wants to build it too. “Creation is my love language,” she says.

Tap the link in our bio for all of the details. 

@BellaHadid photographed by @gvsgvs, styled by @jordenbickham, Vogue, September 2021.
